                    if base_time.weekday() < 5:
                        n = n - 1
                return base_time
            else:
                while n < 0:
                    base_time = base_time - timedelta(days=1)
                    if base_time.weekday() < 5:
                        n = n + 1
                return base_time
    else:
        raise ApplyTypeError("Only know how to combine business hour with datetime")
